import React from 'react'

const Header = () => {
  return (
    <header>
        <Link href="/" className="logo">MYblog</Link>
        <nav>
          <Link href="/login">Login</Link>
          <Link href="/register">Register</Link>
        </nav>
      </header>
  )
}

export default Header
